from typing import List

class Grid:
    def __init__(self, grid: List[List[int]]):
        self.grid = grid
        self.size = len(grid[0])
        self.pathstack = []
        self.deadend = []
        
    def __iter__(self):
        self.pos = (0, 0)
        self.pathstack.append(((0, 0), 0))
        return self

    def __next__(self):
        self.pos = self.pathstack[-1][0]
        #print(" ", self.pos, self.pathstack)
        l = len(self.pathstack) - 1
        if self.pathstack[l][1] == 0:
            self.pathstack[l] = (self.pathstack[l][0], 1)
            if (self.pos[0] + 1) < self.size and (self.pos[1] + 1) < self.size:
                if self.grid[(self.pos[0] + 1)][(self.pos[1] + 1)] == 0:
                    return (self.pos[0] + 1, self.pos[1] + 1)
        if self.pathstack[l][1] == 1:
            self.pathstack[l] = (self.pathstack[l][0], 2)
            if (self.pos[0] + 1) < self.size:
                if self.grid[(self.pos[0] + 1)][self.pos[1]] == 0:
                    return (self.pos[0] + 1, self.pos[1])
        if self.pathstack[l][1] == 2:
            self.pathstack[l] = (self.pathstack[l][0], 3)
            if (self.pos[1] + 1) < self.size:
                if self.grid[self.pos[0]][(self.pos[1] + 1)] == 0:
                    return (self.pos[0], self.pos[1] + 1)
        if self.pathstack[l][1] == 3:
            self.pathstack[l] = (self.pathstack[l][0], 4)
            if (self.pos[0] + 1) < self.size and (self.pos[1] - 1) >= 0:
                if self.grid[self.pos[0] + 1][(self.pos[1] - 1)] == 0:
                    return (self.pos[0] + 1, self.pos[1] - 1)
        return None
        

class Solution:
    def shortestPathBinaryMatrix(self, grid: List[List[int]]) -> int:
        if grid[0][0] == 1 or grid[-1][-1] == 1:
            return -1
        if len(grid[0]) == 1:
            return 1
        minlen = 10000
        g = Grid(grid)
        for p in g:
            #print(p)
            if p is None:
                p = g.pathstack.pop()
                #print(" <-", g.pathstack)
                if len(g.pathstack) == 0:
                    break
                if p not in g.deadend:
                    g.deadend.append(p)
                continue
            if p in g.deadend:
                continue
            g.pos = p
            #print("   ", g.pathstack)
            if minlen > len(g.pathstack):
                g.pathstack.append((p, 0))
            else:
                continue
            #print(" ->", g.pathstack)
            if (p[0] == (g.size - 1)) and (p[1] == (g.size - 1)):
                print("******  ", len(g.pathstack), g.pathstack)
                if minlen > len(g.pathstack):
                    minlen = len(g.pathstack)
                g.pathstack.pop()
        return -1 if minlen == 10000 else minlen

